import React from 'react'

function Search(props) {
    return (
            <div>
                <input onChange = {props.onChange} value = {props.value}
                    placeholder="Search country..."
                />
                <>
                    <button onClick = {props.onClick}>Search</button>
                </>
            </div>
    )
}

export default Search
